// filepath: c:\Users\c.vinay kumar reddy\Videos\React Practice\frontend\src\components\Page\index.js
import React from "react";
import { useParams } from "react-router-dom";
import { HomeData } from "../Home";
import "./inde.css"; // Import the CSS file

const Page = () => {
  const { id } = useParams();
  const data = HomeData[id];

  if (!data) {
    return <h1>Data not found</h1>;
  }

  return (
    <div className="page-container">
      <img src={data.imgurl} alt={data.heading} />
      <h1>{data.heading}</h1>
      <p>{data.content}</p>
    </div>
  );
};

export default Page;
